import React from 'react'
import NavBar from '../utility/NavBar'
import './Header.css'

const Header = () => {
  return (
    <div>
        <NavBar />
        <div style={{height: '432px', backgroundColor: '#E8FCFE'}}></div>
        <div className='line1'></div>
    </div> 
  )
}

export default Header
